import React, { useState } from 'react';
import axios from 'axios';

const CLASS_LABELS = ["Setosa", "Versicolor", "Virginica"];

const PredictForm = () => {
  const [formData, setFormData] = useState({
    dense_2_input: [0, 0, 0, 0],
  });
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleChange = (e, index) => {
    const { value, name } = e.target;
    const updatedValues = [...formData[name]];
    updatedValues[index] = parseFloat(value);
    setFormData({ ...formData, [name]: updatedValues });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const result = await axios.post('http://localhost:8000/predict/iris_model', formData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });
      console.log("Response data:", result.data); // Yanıtın yapısını kontrol et

      // Yanıtın varlığını kontrol et
      if (result.data && result.data.predicted_class && result.data.probabilities) {
        const predictions = result.data.probabilities;
        const predictedClass = result.data.predicted_class;
        setResponse({ predictedClass, probabilities: predictions });
      } else {
        console.log("Predictions data is not available.");
        setError("Prediction data is not available.");
      }
    } catch (error) {
      console.log("Error details:", error);
      setError(error.response ? error.response.data : 'An error occurred');
    }
  };


    return (
      <div>
        <form onSubmit={handleSubmit}>
          <h1>Enter Data for Prediction</h1>
          <div>
            <label>Feature 1:</label>
            <input
              type="number"
              value={formData.dense_2_input[0]}
              onChange={(e) => handleChange(e, 0)}
            />
          </div>
          <div>
            <label>Feature 2:</label>
            <input
              type="number"
              value={formData.dense_2_input[1]}
              onChange={(e) => handleChange(e, 1)}
            />
          </div>
          <div>
            <label>Feature 3:</label>
            <input
              type="number"
              value={formData.dense_2_input[2]}
              onChange={(e) => handleChange(e, 2)}
            />
          </div>
          <div>
            <label>Feature 4:</label>
            <input
              type="number"
              value={formData.dense_2_input[3]}
              onChange={(e) => handleChange(e, 3)}
            />
          </div>
          <button type="submit">Submit</button>
        </form>
        {response && (
            <div>
              <p>Predicted Class: {response.predictedClass}</p>
              <p>Probabilities: {JSON.stringify(response.probabilities)}</p>
            </div>
          )}
          {error && <div>Error: {JSON.stringify(error)}</div>}
      </div>
  );

};

export default PredictForm;
